import React, { type HTMLInputTypeAttribute } from 'react';

type InputProps = {
  id: string;
  name?: string;
  label: string;
  type?: HTMLInputTypeAttribute;
  onChange: (val: any) => void;
};

export const Input = ({
  id,
  name,
  label,
  type = 'text',
  onChange,
}: InputProps) => {
  return (
    <>
      <label htmlFor={id}>{label}</label>
      <input id={id} name={name ?? id} onChange={onChange} />
    </>
  );
};

export default Input;
